  false,\n\t\"url\": null,\n\t\"notes\": \"Rates of long-term and short-term shoreline
  change were generated in a GIS with the Digital Shoreline Analysis System (DSAS)
  version 2.0, an ArcView extension developed by the U.S. Geological Survey (USGS)
  in cooperation with TPMC Environmental Services. The extension is designed to efficiently
  lead a user through the major steps of shoreline change analysis. This extension
  to ArcView contains three main components that define a baseline, generate orthogonal
  transects at a user-defined separation along the coast, and calculate rates of change
  (linear regression, endpoint rate, average of rates, average of endpoints, jackknife).\",\n\t\"owner_org\":
